import React, { useState } from "react";
import ReactJson from 'react-json-view'
import indicators_list from "../../../data/indicators.json"

import './generate-component.css';
const GenerateComponent = ()=>{
    const data = {
        mobile: {
          possibleCountryCodes: ["KE", "UG", "TZ"],
          possibleLengths: {
            national: "5",
            sub_national: "7",
          },
          exampleNumber: 40123,
          nationalNumberPattern: "4\\d{4}",
        },
        id: "AC",
        is_valid_number: true,
        generalDesc: {
          nationalNumberPattern: "[46]\\d{4}|[01589]\\d{5}",
        },
        countryCode: "247",
        uan: {
          possibleLengths: {
            national: "6",
          },
          exampleNumber: 542011,
          nationalNumberPattern: "[01589]\\d{5}",
        },
        references: {
          sourceUrl: "http://www.itu.int/oth/T02020000AF/en",
        },
        internationalPrefix: "00",
        fixedLine: {
          possibleLengths: {
            national: "5",
          },
          exampleNumber: 62889,
          nationalNumberPattern: "6[2-467]\\d{3}",
        },
      };
    return(
<div className='row card'>
<ReactJson src={indicators_list} collapsible view="dual" />
</div>
    );
};

export default GenerateComponent;
